import React from 'react'
import posts from '../data'
import { Container } from 'react-bootstrap'

const Posts = () => {
  return (
    <div>
      <Container>
        <h2>Blog Posts:</h2>
        {posts.map((post) => (
          <div key={post} className='p-2 sm:w-1/2 w-full'>
            <div className='rounded flex p-4 items-center border bg-black'>
              <span className='title-font font-medium text-white'>{post}</span>
            </div>
          </div>
        ))}
      </Container>
    </div>
  )
}

export default Posts
